import React,{Component} from "react";

class NewTask extends Component{
    
    render() {
        return(
            <div className="newBox">
                <label htmlFor="boxText">新建任务:</label>
                <input
                    id="boxText"
                    className="boxText"
                    type="text"
                />
                <button className="boxBtn">保存</button>
            </div>
        );
    }
}
export default NewTask;
